import { useState, useEffect } from "react";

const Delete = (props) => {
  const [data, setData] = useState([]);
  console.log(props);

  useEffect(() => {
    fetch("http://localhost:3001/borrar_producto/" + props.nombre)
      .then((res) => res.json())
      .then((data) => setData(data));
  }, [props.nombre]);
  console.log(data);

  return (
    <div>
      <button className="btn_sup" type="submit">
        Supprimier
      </button>
    </div>
  );
};

export default Delete;
